<div class="entities" style="line-height: 2.5; direction: ltr">Determination of the dose of agomelatine , a melatoninergic agonist and selective 5 - HT ( 2C ) antagonist , in the treatment of major depressive disorder : a placebo-controlled dose range study . 
<mark class="entity" style="background: linear-gradient(90deg, #CC9966, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    DB06594
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">MEN</span>
</mark>
 ( S 20098 ) has a unique and new pharmacological profile . It is a melatoninergic agonist and selective antagonist of 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P28335
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 receptors , and has been shown to be active in several animal models of depression . The aim of this study was to determine the active dose of agomelatine in the treatment of major depressive disorder ( DSM-IV criteria ) . The methodology used was a conventional double-blind design comparing three different doses of agomelatine ( 1 , 5 and 25 mg once a day ) with placebo over an 8 - week treatment period . Paroxetine was used as the study validator . Seven hundred and eleven patients with a baseline mean score of 27.4 on the 17 - item Hamilton Rating Scale for Depression ( HAM-D ) were included . On the pivotal analysis , the mean final HAM-D total score ( Q8N1N2 Analysis Set LOCF ) demonstrated agomelatine 25 mg to be statistically more effective than placebo . This was confirmed by other analyses and criteria ( responders , remission , subpopulation of severely depressed patients , Montgomery-Asberg Depression Rating Scale , Clinical Global Impression-Severity of Illness ) . 
<mark class="entity" style="background: linear-gradient(90deg, #CC9966, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    DB06594
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">MEN</span>
</mark>
 25 mg alleviated the anxiety associated with depression , as measured on Hamilton Anxiety Scale . Paroxetine was found to be effective on pivotal analysis and most of the secondary criteria used to validate the study methodology and population . 
<mark class="entity" style="background: linear-gradient(90deg, #CC9966, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    DB06594
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">MEN</span>
</mark>
 , whatever the dose , showed good acceptability with a side-effects profile close to that of placebo . In conclusion , this study demonstrates that agomelatine is efficient in the treatment of major depressive disorder and that 25 mg is the target dose .</div>

<h2 style="margin: 0">13</h2>

<div class="entities" style="line-height: 2.5; direction: ltr">Financial and psychological risk attitudes associated with two single nucleotide polymorphisms in the nicotine receptor ( 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">

</mark>
 ) gene . With recent advances in understanding of the neuroscience of risk taking , attention is now turning to genetic factors that may contribute to individual heterogeneity in risk attitudes . In this paper we test for genetic associations with risk attitude measures derived from both the psychology and economics literature . To develop a long-term prospective study , we first evaluate both types of risk attitudes and find that the economic and psychological measures are poorly correlated , suggesting that different genetic factors may underlie human response to risk faced in different behavioral domains . We then examine polymorphisms in a spectrum of candidate genes that affect neurotransmitter systems influencing dopamine regulation or are thought to be associated with risk attitudes or impulsive disorders . Analysis of the genotyping data identified two single nucleotide polymorphisms ( SNPs ) in the gene encoding the alpha 4 nicotine receptor (

 , rs4603829 and rs4522666 ) that are significantly associated with harm avoidance , a risk attitude measurement drawn from the psychology literature . Novelty seeking , another risk attitude measure from the psychology literature , is associated with several

</mark>
 ( catechol-O-methyl transferase ) SNPs while economic risk attitude measures are associated with several 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">

</mark>
 ( vesicular monoamine transporter ) SNPs , but the significance of these associations did not withstand statistical adjustment for multiple testing and requires larger cohorts . These exploratory results provide a starting point for understanding the genetic basis of risk attitudes by considering the range of methods available for measuring risk attitudes and by searching beyond the traditional direct focus on dopamine and serotonin receptor and transporter genes .</div>

 cluster coding for the nicotinic acetylcholine receptor ( nAChR ) α3 , α5 and β4 subunits were implicated . In mouse models , we define a key role in the control of sensitivity to nicotine for the α5 subunit in dopaminergic ( DAergic ) neurons of the ventral tegmental area ( VTA ) . We first investigated the reinforcing effects of nicotine in drug-naive α5 ( - / - ) mice using an acute intravenous nicotine self-administration task and ex vivo and in vivo electrophysiological recordings of nicotine-elicited DA cell activation . We designed lentiviral re-expression vectors to achieve targeted re-expression of wild-type or mutant α5 in the VTA , in general , or in DA neurons exclusively . Our results establish a crucial role for α5 * - nAChRs in DAergic neurons . These receptors are key regulators that determine the minimum nicotine dose necessary for DA cell activation and thus nicotine reinforcement . Finally , we demonstrate that a single-nucleotide polymorphism , the non-synonymous α5 variant rs16969968 , frequent in many human populations , exhibits a partial loss of function of the protein in vivo . This leads to increased nicotine consumption in the self-administration paradigm . We thus define a critical link between a human predisposition marker , its expression in DA neurons and nicotine intake .</div>

 ) and thymidylate synthetase ( TS ) polymorphisms in colorectal carcinogenesis . In a study of 816 cases and 815 community controls in Japan , we investigated associations of dietary intakes of folate , methionine , vitamin B2 , vitamin B6 , and vitamin B12 with colorectal cancer risk . The associations with

 2756A &gt; G , Q9UBK8 66A &gt; G , and TSER repeat polymorphism were examined in 685 cases and 778 controls .
